  private int[] concat (int[][] arrays) {
    int n = 0;
    for (int i = 0; i < arrays.length; i++)
      n += arrays[i].length;
    int[] r = new int[n];
    for (int i = 0, k = 0; i < arrays.length; i++)
      for (int j = 0; j < arrays[i].length; j++)
        r[k++] = arrays[i][j];
    return r;
  }

